import logo from "../assets/logo.png";

function Header() {
  return (
    <header>
      <img src={logo} alt="Logo" />
      <nav>
        <a href="#home">Home</a>
        <a href="#about">Sobre</a>
      </nav>
    </header>
  );
}

export default Header;
